import React, { useContext, useState } from 'react'
// import { NameContext, EmailContext, PhoneContext, AdressContext,useName, useEmail, usePhone,useAdress} from './FinalPage'



export const InputForm = ({setName, setAdress, setPhone, setEmail}) => {
    // let name = useName();
    // let email = useEmail();
    // let adress = useAdress();
    // let phone = usePhone();
    let [nameLocal, setNameLocal] = useState('')
    let [emailLocal, setEmailLocal] = useState('')
    let [phoneLocal, setPhoneLocal] = useState('')
    let [adressLocal, setAdressLocal] = useState('')
    const onNameChanged = e => {
        setNameLocal(e.target.value)
        setName(nameLocal)
    }
    const onEmailChanged = e => {
        setEmailLocal(e.target.value)
        // email=''
    }
    const onPhoneChanged = e => {
        setPhoneLocal(e.target.value)
        // phone=''
    }
    const onAdressChanged = e => {
        setAdressLocal(e.target.value)
        // adress=''
    }

  return (
         <form className="submitForm">
                <label htmlFor="name">Name:</label>
                <input
                    type="text"
                    id="name"
                    name="name"
                    value={nameLocal}
                    onChange={onNameChanged}
                />
                <label htmlFor="email">Email:</label>
                <input
                    type="text"
                    id="email"
                    name="email"
                    value={emailLocal}
                    onChange={onEmailChanged}
                />
                <label htmlFor="phone">Phone:</label>
                <input
                    type="text"
                    id="phone"
                    name="phone"
                    value={phoneLocal}
                    onChange={onPhoneChanged}
                />
                <label htmlFor="adress">Adress:</label>
                <input
                    type="text"
                    id="adress"
                    name="adress"
                    value={adressLocal}
                    onChange={onAdressChanged}
                />
        </form>

  )
}
